      >
        {(formik) => {
          //console.log(formik);
          return (
            <Form>
              {/* ==============  modal-header ============= */}
              <div className="modal-header">
                <h1 className=" w-100 fs-5" id="staticBackdropLabel">
                  اضافه کردن گارانتی جدید
                </h1>
              </div>
              {/* ==============  modal-body ============== */}
              <FormikControl
                control="input"
                type="text"
                name="color"
                placeholder="رنگ"
              />
              <div className="text-center">
                <SubmitBtn />
              </div>
            </Form>
          );
        }}
      </Formik>
    </div>
  );
};
